DECLARE
    cocktail_version INT;  -- Declaramos la variable
    original_primera_version INT; -- Variable para almacenar la primera versi??n original
BEGIN

	-- Obtener la versi??n actual del c??ctel
    SELECT Version INTO cocktail_version 
    FROM Cocktail 
    WHERE ID_Cocktail = NEW.ID_Cocktail;
	
